/** @format */

import React from 'react';
import {
  Box,
  Card,
  CardActions,
  CardContent,
  Button,
  Typography,
} from '@mui/material';

const Cards = () => {
  return (
    <>
      <Card sx={{ minWidth: 275 }}>
        <CardContent>
          <Typography sx={{ fontSize: 14 }} color="text.secondary" gutterBottom>
            Balance
          </Typography>
          <Typography variant="h3" component="h4">
            $23,345
          </Typography>
        </CardContent>
      </Card>

      <Card sx={{ minWidth: 275 }}>
        <CardContent>
          <Typography sx={{ fontSize: 14 }} color="text.secondary" gutterBottom>
            Payment Due
          </Typography>
          <Typography variant="h3" component="h4">
            $12,345
          </Typography>
        </CardContent>
      </Card>
    </>
  );
};

export default Cards;
